  return (
    <div className={s.searchBarWrapper}>
      <div>Search Bar</div>
      <div>
        <SearchForm />
      </div>
    </div>
  );
};
const SearchForm = (props) => {
  return (
    <Form onSubmit={props.handleSubmit}>
      <div>
        <Field
          component={"input"}
          name={"chatText"}
          placeholder="Type your message"
        />
      </div>
      <div>
        <button>send</button>
      </div>
    </Form>
  );
};

export default SearchBar;
